import './Header.scss';
import React from 'react';
import logo from '../../images/logo.svg';

const Header = () => {

    return (
    <div className="header">
        <img className="logo" src={logo} alt='logo'/>
        <div className="header-links">
            <a className="header-link" href="#"><span>A</span>bout</a>
            <a className="header-link" href="/"><span>S</span>kills</a>
            <a className="header-link" href="/"><span>F</span>ormations</a>
            <a className="header-link" href="/"><span>P</span>ortfolio</a>
            <a className="header-link" href="/"><span>C</span>ontact</a>
        </div>

    </div> 
    )
};

export default Header;
